void caasPSM4TxHOG::LocateArrayblock()
{
	int width = (int)(imageGray.cols / ARRAYBLOCK_SCALING + 0.5),
		height = (int)(imageGray.rows / ARRAYBLOCK_SCALING + 0.5);
	Mat imageSmall; resize(imageGray, imageSmall, Size(width, height));

	//We search to the left edge of isolator + arrayblock's width.
	int left = 0, right = (int)((isolatorLeftEdge + ARRAYBLOCK_SIZE_ORIGINAL.width) / ARRAYBLOCK_SCALING + 0.5), top = 0, bottom = height;
	arrayblockROI = Rect(left, top, right - left, bottom - top);
	imageSmall = imageSmall(arrayblockROI);

	Size winStride(4, 4); std::vector<cv::Point> foundLocations; std::vector<double> weights;
	arrayblockHOG.detect(imageSmall, foundLocations, weights, 0.0, winStride);

	arrayblockHOGResults.clear();
	for (int i = 0; i < weights.size(); i++)
	{
		if (foundLocations[i].y <= 0) continue;
		if (foundLocations[i].y + ARRAYBLOCK_SIZE_HOG.height >= height) continue;
		if (foundLocations[i].x <= 0) continue;
		if (foundLocations[i].x + ARRAYBLOCK_SIZE_HOG.width >= width) continue;

		HoGResult hog_result;		hog_result.weight = weights[i];		hog_result.location = foundLocations[i];
		arrayblockHOGResults.push_back(hog_result);
	}

	if (arrayblockHOGResults.size() <= 0) throw "Locating ArrayBlock Error!";

	sort(arrayblockHOGResults.begin(), arrayblockHOGResults.end(), SortHoGResultByWeight);
}

